import React from "react";
import Restaurant_card from "../../../restaurant-card/Restaurant_card";
import "./Popular_restaurant.css";


const Popular_restaurant: React.FC = () => {
      return (
      <>
      <span id="popular_restaurant_headling">POPULAR RESTAURANT IN EPICURE:</span>
      <div className="popular_restaurant">
            <Restaurant_card img="https://static.vecteezy.com/packs/media/vectors/term-bg-1-3d6355ab.jpg" chef="Ran Shmueli" rating={5} name="Claro" />
            <Restaurant_card img="https://static.vecteezy.com/packs/media/vectors/term-bg-1-3d6355ab.jpg" chef="dsadsa" rating={2} name="dsadsa" />
            <Restaurant_card img="https://static.vecteezy.com/packs/media/vectors/term-bg-1-3d6355ab.jpg" chef="dsadsa" rating={3} name="dsadsa" />
        </div>
        </>
      )
    }

export default Popular_restaurant;
